from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message


from stw_gen_sample3_api.types.core.time.gps_type import Gps


@dataclass
class FaultTransceiver(_Message):

    # Бортовое время последнего детектирования сигнала fault от трансивера
    faultTime: Gps
    # Общее количество fault сигналов от трансивера
    faultCount: uint32_t


class FaultTransceiverDict(TypedDict):

    # Бортовое время последнего детектирования сигнала fault от трансивера
    faultTime: Union[Gps]

    # Общее количество fault сигналов от трансивера
    faultCount: Union[uint32_t, int ]

